import React from "react";

export default function Weather() {
  //use state to get input from form
  fetch(
    `api.openweathermap.org/data/2.5/weather?q=salisbury&appid=26ce245088c3cd75b76abae32afa318b`
  )
    .then((response) => response.json())
    .then((data) => console.log(data))
    .catch((err) => alert("wrong city name"));

  return (
    <div className="weatherContainer">
      <div className="waeatherInputContainer">
        <input type="text" placeholder="enter a city" className="inputValue">
          {" "}
        </input>
        <input type="submit" value="submit"></input>
      </div>
      <div className="weatherDisplayContainer">
        <div className="location"></div>
        <div className="temperature"></div>
        <div className="weatherDescription"></div>
      </div>
    </div>
  );
}
